script: |
  super -f text -I q11773.spq | sort > q11773.out

inputs:
  - name: q11773.spq
    data: |
      SELECT DISTINCT - col0 * - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE ( NOT col1 * col0 BETWEEN ( col1 ) AND - col2 * col0 );
  - name: tab0

outputs:
  - name: q11773.out
    data: |
      705
      870
      9603
